$(function(){
  
  // 将扑克图片存入localStorage
  (function(){
    if(localStorage.getItem('guessImages')){
      return;
    }else{
      var imgData = {
      'image1': 'data:image/jpg;base64,',
      'image2': 'data:image/jpg;base64,',
      'image3': 'data:image/jpg;base64,',
      'image4': 'data:image/jpg;base64,',
      'image5': 'data:image/jpg;base64,',
      'image6': 'data:image/jpg;base64,',
      'image7': 'data:image/jpg;base64,',
      'image8': 'data:image/jpg;base64,',
      'image9': 'data:image/jpg;base64,',
      'image10': 'data:image/jpg;base64,',
      'image11': 'data:image/jpg;base64,',
      'image12': 'data:image/jpg;base64,',
      'image13': 'data:image/jpg;base64,',
      }

      localStorage.setItem('guessImages',JSON.stringify(imgData))
      
    }
  })()

  // 显示记录
  $("#my-records-btn").on("click", function() {
    $("section.bhz-mod-shadow").fadeIn(500);
    $("#my-records").show().animate({
      top: '20%',
      opacity: 1
    }, 500)
  });
  $("#game-rules-btn").on("click", function() {
    $("section.bhz-mod-shadow").fadeIn(500);
    $("#game-rules").show().animate({
      top: '20%',
      opacity: 1
    }, 500)
  });
  // 隐藏记录
  $("section.bhz-mod-shadow").on("click", function() {
      $("section.bhz-mod-shadow").fadeOut(500);
      $("#my-records").animate({
        top: '100%',
        opacity: 0
      }, 500, function() {
        $("#my-records").hide();
      });
      $("#game-rules").animate({
        top: '100%',
        opacity: 0
      }, 500, function() {
        $("#game-rules").hide();
      });
    })
    // len为投注按钮数
  var len = $(".bhz-mod-bet>.bhz-mod-bet-num").length;
  var oImagesUrl = JSON.parse(localStorage.getItem('guessImages'))
  var arrUrl = [oImagesUrl.image1,
    oImagesUrl.image2,
    oImagesUrl.image3,
    oImagesUrl.image4,
    oImagesUrl.image5,
    oImagesUrl.image6,
    oImagesUrl.image7,
    oImagesUrl.image8,
    oImagesUrl.image9,
    oImagesUrl.image10,
    oImagesUrl.image11,
    oImagesUrl.image12,
    oImagesUrl.image13
  ];
  var randomNum = 0;

  function getRandomNum() {
    return Math.floor(Math.random() * 13);
  }
  for (var i = 0; i < len; i++) {
    $("#bet-btn-" + i).click(function() {
      $(this).addClass("clicked").siblings().removeClass("clicked");
    })
  }
  // 选大小
  $(".bmf-info-common").click(function() {
      $(this).addClass("selected").siblings().removeClass("selected");
    })
    // 开奖
  $(".bhz-mod-bet-btn").click(function() {

      if(($("#my-peas").text()-0)<($(".bhz-mod-bet-num.clicked").text()-0)){
        alert('爱豆不足');
        return
      }
      

      $("#tip-00").show()
      $("#for-tip").show()
      // ajax 
      $.ajax({
        type: 'POST',
        data: {userChoose:$(".bmf-info-common.selected").text(),peasNum: $(".bhz-mod-bet-num.clicked").text()-0},
        url: 'http://192.168.158.104:3000/guess/result',
        cache: false,
        timeout: 5000,
        success: function(data){
          $("#tip-00").hide()
          $("#for-tip").hide()
          $("#the-result").text(data.out.result);
          $('.bhz-mod-flop-info.back').css('background-image', 'url(' + arrUrl[data.num] + ')');
          if(data.peas > 0){
            $(".peasAdd").text('+'+data.peas)
            $("#tip-01").show().animate({
              top: '74%'
            }, 1000,function(){
              $("#my-peas").text($("#my-peas").text()-0+data.peas)
            })
            $("#for-tip").show()
          }else{
            $(".peasAdd").text(data.peas)
            $("#tip-02").show().animate({
              top: '74%'
            }, 1000,function(){
              $("#my-peas").text($("#my-peas").text()-0+data.peas)
            })
            $("#for-tip").show()
          }
          $('#card').addClass('rotate');

          // var data = JSON.stringify(data);
          // alert(data);
        },
        error: function(jqXHR, textStatus, errorThrown){
          $("#for-tip").hide()
          alert('error ' + textStatus + " " + errorThrown);  
        }
      });


      
      
    })
    // 重新初始化开奖
  $("#for-tip").click(function() {
    $('#card').removeClass('rotate');
    $("#tip-01").css("top", "100%").hide();
    $("#tip-02").css("top", "100%").hide();
    $(this).hide();
  })

  
})